1:{i:0;a:5:{s:4:"data";s:2934:"<p>April turned out to be a slow month in Akismetland. The highest number of spam comments we saw come in this month on a given day was about 177 million. The total amount of spam we saw come through this month is 23% less than last month, and 33% less than April of last year.</p>\n<p>Here&#8217;s a chart showing the number of spam and ham comments we saw come through each day this month:</p>\n<p><img class="alignnone size-large wp-image-1840" src="https://akismet.files.wordpress.com/2015/05/akismet-spam-and-ham-stats-april-2015.png?w=700&h=438" alt="graph of akismet spam and ham daily stats April 2015" /></p>\n<div id="attachment_1841" class="wp-caption alignright"><img class="size-medium wp-image-1841" src="https://akismet.files.wordpress.com/2015/05/time_machine.jpg?w=300&h=252" alt="This image, .Time Machine. by Sachin Sandhu, is licensed under CC BY 2.0" width="300" height="252" /><p class="wp-caption-text">This image, <a href="https://www.flickr.com/photos/sachin_sandhu/2711789618">.Time Machine.</a> by <a href="https://www.flickr.com/photos/sachin_sandhu/">Sachin Sandhu</a>, is licensed under <a href="https://creativecommons.org/licenses/by/2.0/">CC BY 2.0</a></p></div>\n<p>The total number of spam comments this month is <strong>4,167,247,500</strong> &#8211; just over four billion, which is still a big number even though it&#8217;s a slow month ', 'no'),
