(31404, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2015/04/wordpress-4-2-1/\'>WordPress 4.2.1 Security Release</a> <span class="rss-date">April 27, 2015</span><div class="rssSummary">WordPress 4.2.1 is now available. This is a critical security release for all previous versions and we strongly encourage you to update your sites immediately. A few hours ago, the WordPress team was made aware of a cross-site scripting vulnerability, which could enable commenters to compromise a site. The vulnerability was discovered by Jouko Pynnönen. [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'http://blog.akismet.com/2015/05/01/april-2015-stats-roundup/\'>Akismet: April 2015 Stats Roundup</a></li><li><a class=\'rsswidget\' href=\'http://ma.tt/2015/04/changing-americas-mind/\'>Matt: Changing America’s Mind</a></li><li><a class=\'rsswidget\' href=\'http://wptavern.com/how-to-restore-the-link-title-attribute-removed-in-wordpress-4-2\'>WPTavern: How to Restore the Link Title Attribute Removed in WordPress 4.2</a></li></ul></div><div class="rss-widget"><ul><li class=\'dashboard-news-plugin\'><span>Popular Plugin:</span> <a href=\'http://wordpress.org/plugins/photo-gallery/\' class=\'dashboard-news-plugin-link\'>Photo Gallery</a>&nbsp;<span>(<a href=\'plugin-install.php?tab=plugin-information&amp;plugin=photo-gallery&amp;_wpnonce=df578edbfd&amp;TB_iframe=true&amp;width=600&amp;height=800\' class=\'thickbox\' title=\'Photo Gallery\'>Install</a>)</span></li></ul></div>', 'no'),
