(20, 1, '2014-02-25 13:54:21', '2014-02-25 13:54:21', '<h3>What information do we collect?</h3>\r\n<div>\r\n\r\nWe collect information from you when you register on our site, place an order, subscribe to our newsletter, respond to a survey, fill out a form or send band information.\r\n\r\nWhen ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address or phone number. You may, however, visit our site anonymously.\r\n<h3>What do we use your information for?</h3>\r\nAny of the information we collect from you may be used in one of the following ways:\r\n\r\n; To personalize your experience\r\n(your information helps us to better respond to your individual needs)\r\n\r\n; To improve our website\r\n(we continually strive to improve our website offerings based on the information and feedback we receive from you)\r\n\r\n; To improve customer service\r\n(your information helps us to more effectively respond to your customer service requests and support needs)\r\n\r\n; To administer a contest, promotion, survey or other site feature\r\n\r\n; To send periodic emails\r\n<blockquote>The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.</blockquote>\r\nNote: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.\r\n<h3>How do we protect your information?</h3>\r\nWe implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.\r\n\r\nWe offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to?keep the information confidential.\r\n\r\nAfter a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.\r\n<h3>Do we use cookies?</h3>\r\nYes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information\r\n\r\nWe use cookies to understand and save your preferences for future visits, keep track of advertisements and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.\r\n\r\nIf you prefer, you can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies via your browser settings. Like most websites, if you turn your cookies off, some of our services may not function properly. However, you can still place orders over the telephone or by contacting customer service.\r\n<h3>Do we disclose any information to outside parties?</h3>\r\nWe do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.\r\n<h3>Third party links</h3>\r\nOccasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.\r\n<h3>California Online Privacy Protection Act Compliance</h3>\r\nBecause we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.\r\n<h3>Childrens Online Privacy Protection Act Compliance</h3>\r\nWe are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.\r\n<h3>Online Privacy Policy Only</h3>\r\nThis online privacy policy applies only to information collected through our website and not to information collected offline.\r\n<h3>Your Consent</h3>\r\nBy using our site, you consent to our web site privacy policy.\r\n<h3>Changes to our Privacy Policy</h3>\r\nIf we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.\r\n\r\nThis policy was last modified on 2/25/2014\r\n<h3>Contacting Us</h3>\r\nIf there are any questions regarding this privacy policy you may contact us using the information below.\r\n\r\nhttp://dev.bronsonrocktx.com\r\n\r\nBronson Rock\r\ninfo@bronsonrocktx.com\r\n\r\n</div>', ' Privacy Policy', '', 'publish', 'closed', 'open', '', 'privacy', '', '', '2015-03-25 11:38:50', '2015-03-25 17:38:50', '', 0, 'http://nick.bronsonrocktx.com/?page_id=20', 12, 'page', '', 0),
