(353, 1, '2014-05-07 14:20:56', '2014-05-07 20:20:56', '<h1>Hours &amp; Location</h1>\r\n<address>250 S. Main St.\r\nKeller, TX 76248</address>\r\n\r\n<hr />\r\n\r\n<h3>Monday:</h3>\r\nCLOSED\r\n<h3>Tuesday-Wednesday:</h3>\r\n11:00 am-12:00 am\r\n<h3>Thursday:</h3>\r\n11:00 am-1:00 am\r\n<h3>Friday-Saturday:</h3>\r\n11:00 am-2:00 am\r\n<h3>Sunday:</h3>\r\n11:00 am-6:00 pm\r\n\r\n<small>**We do not take reservations</small>', 'Hours & Location', '', 'publish', 'closed', 'closed', '', 'location', '', '', '2014-11-16 10:31:15', '2014-11-16 16:31:15', '', 0, 'http://nick.bronsonrocktx.com/location/', 18, 'page', '', 0),
