(674, 3, '2015-02-18 10:41:51', '2015-02-18 16:41:51', '<div class="row daySpan">\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Mon</h2>\n\n<hr />\n\n<ul>\n	<li>Closed</li>\n</ul>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Tue</h2>\n\n<hr />\n\n<ul>\n	<li>Half-Price Burgers (Add $1 for take out)</li>\n	<li>$3 U Call It Crown &amp; Down</li>\n	<li>$4 Frozen Margaritas</li>\n	<li>*Except on holidays or special events</li>\n</ul>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Wed</h2>\n\n<hr />\n\n<ul>\n	<li>From 11am-Close</li>\n	<li>Chopped Steak w/Mushroom Gravy! ($6.99)</li>\n	<li>$3 House Wine</li>\n	<li>$3 Wells</li>\n	<li>$3 Pints</li>\n</ul>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Thu</h2>\n\n<hr />\n\n<ul>\n	<li>From 11am-7pm</li>\n	<li>Taco Salad! ($6.99)</li>\n	<li>Cordials (Jager, Fireball, Rumple, Goldschlager, Tuaca)</li>\n	<li>Domestic Buckets</li>\n	<li>Jim, Jack &amp; Jose</li>\n	<li>Domestic Bottles</li>\n</ul>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Fri</h2>\n\n<hr />\n\n<ul>\n	<li>From 11am-7pm</li>\n	<li>Patty Melts ($6.99)</li>\n	<li>Wells</li>\n	<li>Domestic Drafts</li>\n	<li>Domestic Buckets</li>\n	<li>Import Buckets</li>\n</ul>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Sat</h2>\n\n<hr />\n\n<li></li>\n</div>\n<div class="col-md-2">\n<h2 style="font-size: 20px;">Sun</h2>\n\n<hr />\n\n<ul>\n	<li>From 11am-Close</li>\n	<li>Wells</li>\n	<li>Domestic Buckets</li>\n	<li>Import Buckets</li>\n	<li>Mimosa</li>\n	<li>Bloody Mary</li>\n</ul>\n</div>\n</div>', 'Specials', '', 'inherit', 'open', 'open', '', '350-autosave-v1', '', '', '2015-02-18 10:41:51', '2015-02-18 16:41:51', '', 350, 'http://dev.bronsonrocktx.com/350-autosave-v1/', 0, 'revision', '', 0),
