(14, 'Please bring back RADIO KAOS Band!!!\r\nWe\'ve been with you guys since the beginning and are booking dates for next year. Our friends & fans are asking about 2015 dates. We are committed to putting on a GREAT show to GREAT crowds every time we play!!!!'),
(19, 'I played at Bronson with my band on a Sunday night a couple months ago. You guys loved me and said you wanted to get me back. I\'d love to play a Thursday acoustic set. Let me know what the budget for that would me. \r\n\r\nThanks,\r\nKate'),
(24, 'Hi,\r\n\r\nThis is the second time I  am writing you. I hope this time you answer:\r\n\r\nI would like to inform you that I was in your restaurant last Friday (9/12/14) having dinner and I expended $35.22 but I checked in my credit card account that I received three different charges from your restaurant: $35.22, $36.49 and $82.22 \r\nPlease double check and advise at your earliest convenince.\r\nI expect a refund from your company regarding the last two charges.\r\n\r\nTks\r\n\r\nPAZ LATOVA'),
(32, 'Bronson Rock Booking,\r\nThis is Matt Jones from the band Songbird Jones. I am interested in playing for y\'all on a Wednesday or Thursday night as an acoustic duo. My lead guitarist is from Keller and we play everything from oldies to rock to country and originals as well. We would love to play for you.\r\nPlease let me know what you need from me to get on your calendar.\r\nThanks,\r\nMatt'),
(40, 'Hello,\r\nMy band Full Tilt would love to play Bronson Rock, We are from Keller and have a good fallowing in Keller. We play rock from Led Zeppelin, ACDC, Black Keys, Alice n Chains, Toadies, Black Crowes, ZZ Top, Bad Company etc. We also just released a cd of original music. There are live videos and 3 songs from out cd our site. We can play whatever nights but it sounds like Thursday is your rock night or bike night. We can kill it. Thanks.'),
(53, 'Hello, \r\n\r\nWe are Grohl, a Foo Fighters/Dave Grohl Tribute band.  We play songs from the Foo\'s, Nirvana, and Queens of the Stone Age.\r\n\r\nWe are interested in playing your venue and are available for booking starting mid-November. Our average crowd size is 20-25.\r\n\r\nWe hope you will consider us.  We currently have 2  1/2 hours of music and can gauge it for any crowd.  Below is our website, promotional video link and song list.  Thank you\r\n\r\nwebsite - www.grohldfw.com \r\nvideo link - http://youtu.be/lwKN2MyUtYw\r\nsong list - \r\nFoo Fighters; Monkey Wrench, Everlong, My Hero, Best of You, All my Life, The Pretender, Rope, Times Like These, This is a Call, Learn to Fly, Wheels, These Days, I\'ll Stick Around, Walk, Big Me, Bridge Burning.\r\nNirvana; Breed, Smells Like Teen Spirit, In Bloom, You Know You\'re Right.                                             Queens of the Stone Age; No One Knows, Go With the Flow\r\n\r\nKelly Mader from Grohl\r\n214-773-5444'),
(67, 'What is the schedule for open mic night?  Is it every week?  If yes, what is the day and hours?\r\n\r\nIs there a house P.A.  a band can use to mic amps and drums?\r\n\r\nIs there a house set of drums?\r\n\r\nHow does a band schedule?  First come, first serve?\r\n\r\nHow long of a set?\r\n\r\nAre samples of music required to audition?\r\n\r\nThanks!\r\n\r\nYou can simply send an email?'),
(72, 'SAVE, PRINT, POST and SHARE\r\n\r\n\r\nBRONSON ROCK \r\n\r\nThank you for your time and business in advance.  I will be your Glazers rep (Inside Sales) going forward.  \r\n\r\nYour GLAZERS ACCT is #16191    \r\n\r\nYou can have me to call you each week to take your order or you can call in or email your order directly to me-as long as I have your order by 3:30 pm on the business day (TUESDAY) before your delivery day(s).  NOTE: Some may find it more convenient to email the order as I am on the phone throughout the day.\r\n\r\nPlease include Account # or business address and indicate Cases or Bottles per item with your order.\r\n\r\nDo not hesitate to contact me if you have questions or need more information.\r\n\r\nHave a Super Week!\r\n\r\nGerald J. Green\r\nInside Sales Account Executive\r\n13755 Diplomat, Suite 300\r\nFarmers Branch, TX 75234\r\nDirect: 972.280.8708\r\nToll Free: 855.371.2999\r\ngerald.green@glazers.com'),
(79, 'Entertaining, high energy live show. \r\nGreat originals mixed with unique takes on old favorites.\r\nwww.plasticgravity.com  \r\nSolo or duo acoustic shows, as well as a full-tilt rock band, depending on your needs. \r\n\r\nFor bookings please reply to this e-mail or call Kelly @ 817-233-0416\r\nPlease note: We do not currently text. Phone calls or e-mails only, please!\r\nThanks.'),
(84, 'Hello there. Sparky Sorenson here. I will be filming the big Incognito 25th anniversary show on Oct. 24th. Basically, I would like to set up a time to talk to the manager about a few logistical things before hand. I filmed them there last fall and have a few ideas for a couple of camera locations that will not interfere with the customers.  If you could please have them call me at 817-271-3995 so we can set up a time for a quick meeting I would greatly appreciate it. Thanks!\r\n\r\nSparky Sorenson\r\nSparky\'s Video Productions\r\n817-271-3995\r\nwww.sparkyvideoproductions.com'),
(91, 'We are also on Facebook and that page has several videos posted. We are relatively new but the response for us in the Dallas area has been overwhelming. We\'d love to get our foot in the door of the mid-cities and west side of town. Let\'s talk about booking a date at your place. Thanks!\r\nwww.intothewestband.com\r\n\r\nhttps://www.facebook.com/video.php?v=10202804115642535&set=vb.1190103465&type=2&theater'),
(103, 'We visited your establishment this afternoon and we\'re VERY disappointed in the food & service.  I understand that it is a Saturday afternoon but I would think yall would be better prepared. Was it yall\'s first Saturday being open? ? The waitress could do nothing but put the blame on the kitchen and even commented that we didn\'t order what we knew we ordered!  We ended up leaving without getting one of two meals we ordered and the couple we came with didn\'t get what they ordered as well!!   The couple called to speak to the manager after we left but MYSTERIOUSLY the guy on the other end couldn\'t understand him and could only say that yall were busy.....which is ridiculous!  This man waited 45mins in your restaurant only to end up leaving and eating a sandwich from QT in his car!  If yall can\'t handle the business or your waitresses can\'t stop flirting long enough to properly do their job than step aside and close your doors. Spring Creek, Up in Smoke, or hell....even Arbys are more than willing to take whatever business yall can\'t handle. We will not be returning to Bronson Rock and are sure the people who were with us will not return as well...not to mention we are sure to spread the word of our ridiculous experience.'),
(108, 'I was in your establishment last night with 10 other people. we were there to hear New Ground, we like their music.  we had planned on staying for at least one set and may be some would have stayed later.  Your website stated that the band started at 9:00. at 9:45 they still hadn\'t started and our group left.  I know you don\'t need my business as long as there are blue collar workers but I\'m just expressing my dismay about coming that late and being very disappointed.  You have Jam Wow there next weekend and the website states that they will start at 8:00.  Wonder if that will be true???  Thanks for your ear.'),
(134, 'Hi, my name is Brandon Burnett. I am a singer-songwriter from Ft. Worth. I was wondering about info on booking an acoustic gig at your location in Keller. I play folk and country and I have a setlist of original and cover songs. You can email or call my any time of day at 682-333-2206. You can hear recordings of my original songs on my bandcamp profile. Thank you for your time.'),
(143, 'Hi,\r\nI love your bar!!! I live in Colorado and everytime I come home to Texas I stop in. Last time I was there the manager gave me a Rock Hard tshirt and I wear it so much it is worn out. I am advertising for ya\' all in Colorado :) Is there a way I could purchase another one? It\'s black yellow writing and v neck ladies tshirt. \r\nThanks!\r\nPam'),
(150, 'Good Afternoon,\r\n\r\nMy name is Katy Sewell and I\'m looking for a venue to host a going away party for a colleague of mine this Friday the 7th from about 5:00-8:00p. There will be about 40 people attending, is there a way I could reserve a room or space for this event to ensure our large party can hang out together?\r\n\r\nThank you in advance for your time I really appreciate it! Please reach out to me via email it\'s the best and most efficient way to get a hold of me. Looking forward to working with y\'all!\r\n\r\nKaty'),
(156, 'Hi! The staff at NOVA Hair Studio and Taperz Barber shop are inquiring about having our Christmas party at Bronson Rock. We have a few questions such as: Do you offer a separate room for parties? Do you have any specials for food with large groups? Do you sell pitchers of beer? Our party is going to be Saturday, December 13 in the evening.  Please email or call me back so we can book our party! Thank you in advance!\r\nChelsey Mieling \r\nSalon Coordinator'),
(178, 'I am looking for information to book a 30th birthday party on Dec. 5th, or 6th. Pricing, what\'s included or is it more of just making a reservation? Any information would be greatly appreciated. \r\n\r\nThank you,\r\nTiffany'),
(188, 'My husband, myself and 9 other friends went to Bronson Rock Friday Nov 14 to see a band that were very fund of ( Saints & Saviors)only to get there to find out they were cancelled without any type of notification on your Web page or FB page. We ran into several other people that were there to see the band and were very disappointed just like us. Of course we left and so did the other people, I had no desire to stay and watch a lip singing band that did not come close to playing their own instrument.  We are a fan of "live" music. I also noticed that Saints & Savior\'s are not on your schedule for the rest of the year, this is a huge disappointment to us, as we "were" loyal customers to Branson Rock.'),
(198, 'Bronson,\r\nWe are a pro level, 8 piece rock n\' roll show band that has played HOB, Bedford Blues Festival (5000 present),  the Rockwall Independence Celebration (in front of 10,000) and many other high profile venues.  We can bring the full outfit with horns, keys, stage, lights and sound, and we will promote the show to our nearly 6000 fans on FB. We are looking to set our 2015 schedule, and would love to get in your rotation.  Let me know.\r\nthanks,\r\nRyon'),
(205, 'Since I have no idea in total how many people might show up I did not think to contact or ask. But if I wanted to do a special area with a little space for a birthday celebration how does that work?  My husband frequent Bronson Rock.  \r\nI\'m looking at tomorrow evening around 8pm. Also his favorite bar tenders are Dani and Lele...he\'s a good tipper, so they probably know him well.  Any idea if they are working tomorrow night?'),
(224, 'Greetings,\r\n\r\nHere at Integrity Artist Agency we hope this communication finds you in good health and spirits.  We are contacting you in regards to one of our artists, Jacob Miller, of Fort Worth, Texas.  With the holidays right around the corner and the busy touring schedule to follow, we are looking for some local venues to fill in the gaps.  Jacob is a new,  independent, hot commodity artist that is sure to please whatever crowd he\'s playing for.  To book Jacob, please feel free to contact an IAA booking agent. We look forward to hearing from you!'),
(229, 'I represent a restaurant space that I think could be a great new location for you. The space is located in Solana Business Park in Westlake.  We have a 4,803 sf former Mexican restaurant with a large patio. You can view the property flier on the link below:\r\n\r\nhttp://ucr.com/wp-content/uploads/2014/12/Solana-Retail-Westlake-Property-Flyer.pdf\r\n\r\nWho is the appropriate person to speak with about this possible new location? \r\n\r\nThanks, \r\n\r\nGordon Atkinson\r\nVice President\r\nUCR'),
(236, 'I would like to see about having little Ozzy perform at your venue. Little Ozzy is a 4\'8" tribute artist of Ozzy Osborne. He has had great international success with his show and has almost a "cult" following. Little Ozzy has had numerous tv appearances and would be a great draw at your venue. please review the link below.\r\n \r\nhttp://littleozzyrocks.com'),
(250, 'Hello, my name is Skyler Liv and I am a acoustic solo artist! I would love to preform some love music at Bronson Rock in Keller! You can send me an email: Skylerlivmusic@gmail.com and you can check out my youtube account Skyler Liv to get a feel for what I play! Thanks so much and I hope to hear back from you shortly!'),
(263, 'Hi, is there anything special to do for planning a birthday party or is it based on first come basis for inside tables in band area? \r\n\r\nAlso, is there an age limit and if so, until what time?\r\n\r\nThank you,\r\n\r\nAngie'),
(268, 'There is a female producer artist I\'d like to possibly have come play at your venue. I\'ve been coming to your location for about 2 years  one of male individual that will always come and dance at your location and pump up the crowd.I prefer this message be reviewed by Tonya.I would be happy to make this introduction to you and the artist and leave it up to the two of you decide whether you\'d like to do business.she has a large following.and it will bring a different genre: possibly be played in the back room where the pool tables are. papermoonproductions.podomatic.com'),
(273, 'We are the local rugby in Keller, Alliance Rugby, and just formed a men\'s side.  We will be playing our home matches at Keller Sports park with our first match this Saturday.\r\n\r\nAlliance rugby is looking for a place to host an after party for 40 people.  \r\n\r\nWe are 501c3 club to help with a tax write off to. \r\n\r\nWould Bronson Rock be interested in hosting these events?'),
(278, 'Good Afternoon,\r\n        I am contacting you to obtain information on employment at your establishment. I am currently a bartender in Dallas and I am looking for a change of scenery and was wondering if you guys are currently hiring. If so I would love the opportunity to interview with you . Looking forward to your reply , Have a great day!!\r\n\r\nThanks,\r\nAshley Foust'),
(301, 'The Red Pearl Band is starting to book for next year. We are a variety band and will keep your dance floor packed. We play country, red dirt, r&b, dance, pop and rock.\r\n\r\nThanks and happy holidays.       Steve'),
(309, 'Wanted to let you guys know that Jeep night on 3rd Wed of each month will start back up this next month - January. We took off for the holidays. Might be a slow start, but letting you know we will start back up again, and hope to see Harmony as our staff member - SHE ROCKS. \r\n\r\nSee you Jan 21. Happy New Year.'),
(321, 'MY SUGGESTION GIVE MORE INFORMATION ON YOUR WEBSITE!  I am trying to decide what to do on New Years Eve with my friends but your website just shows a bash.  What is Bronson\'s Bash?   There is no detail about anything anywhere.....?'),
(329, 'TEAZUR is a rock cover band out of Tyler, TX (about 2 1/2 hours from Keller. We are looking for a venue in the DFW area to play in our rotation. Bronson Rock looks like the perfect fit for us. Our live show is very upbeat, and patron friendly.  We are the top ranked rock act for the Tyler/Longview area on Reverbnation. We look forward to hearing from you, and Happy New Year!'),
(334, 'This is Christyn Wachowiak. I have had an address change since I last worked at Bronson Rock. I just wanted to make sure my w2 was going to be mailed to the correct address. My new address is \r\n6117 Kristen Dr.\r\nFort Worth, TX 76131\r\n\r\nIf there is anything else I need to do please let me know.  Thank you.\r\n\r\nChristyn Wachowiak'),
(340, 'Hello,\r\n\r\nThis is Richard Hoang with K Magazine.\r\n\r\nI recently talked with a manager on Friday in regards about if Bronson Rock will be hosting a Super Bowl watch party.\r\n\r\nCall me or email me as soon as you can. My deadline is January 8.'),
(348, 'No other band in the Dallas-Fort Worth area merges the intricate fusion of rhythm-section funk/rock, 4-horn firepower, and soaring vocals the band throws down each time they play live.  Featuring the DTM Horns on their front line, Don’t Tell Mama is a live, for real, variety dance band that has been building a loyal and ever-growing following for over eight years - featured at festivals, private and corporate events, as well as many charity and fundraising events across the north central Texas area.  \r\n\r\nA 10 piece variety dance band that is ready to get your party started, with a wide range of great dance music from the 60’s through today’s modern pop.  Playing songs of the most popular chart hits from Motown, Funk, Disco, R&B, Jazz, Classic Rock, and Top 40, Don’t Tell Mama truly has taken their audience to an even higher level in entertainment.  They can customize your music entertainment package according to your theme and with advanced notice, add those special requested songs to make your event even more complete.\r\n\r\nDTM has recently stepped up their game with a full-length release of an EP entitled “Got It Covered”- an album full of cover songs that feature some of the best of what Don’t Tell Mama has to offer.  “Got It Covered” is a genuinely compelling funk/rock/old school/horn-band experience\r\n\r\nPlease contact Glenn Lightford for bookings.'),
(365, 'The KYA 10U Chargers is an Elite Baseball Team that has played together since 2013.  We play at a AA or lower AAA level.  The competition is exciting and rewarding for our boys.  They learn teamwork, courage, perseverance, and leadership.  We have some really talented young athletes on the team.  That being said, we incur many financial obligations throughout the season ranging from uniforms, equipment, tournament fees, to batting cage expenses.  We are actively seeking sponsorships for our team to keep baseball affordable for every member on our team.\r\n\r\nPlease consider sponsoring our team.  Your donation is tax-deductible.  Any donation of $200 or more will have their business logo promoted on our team banner, which we showcase at every game and tournament.'),
(370, 'My name is Savanah Hollowell, I handle marketing for a summer camp that is located in Keller. A lot of our participants are around the area and all love this place. We were wondering if it could be considered to do a fundraiser night/day that if people came in a certain proceeds could come back to us, for a scholarship for a kid to be able to go to camp. I would love to talk more about this. Please let me know at your earliest convenience.'),
(375, 'Good Afternoon Management,\r\n\r\n\r\nI am following up on your account, we spoke before the holidays and I wanted to send you a quick snap shot of how to enhance your local listing and overall business with this new cutting edge product.\r\n\r\n Enhancing your business\'s local listing with Google Business View gives a consumer even more reasons to do business with you...From making sure your Google Plus Page has the most accurate and up to date information on your location, to making sure your standard or HDR (High Def Resolution) Photos pop out on your local listing page, so when someone finds you on Google your photos match your description of your location. To customizing your 360° virtual tour by enhancing everything your location has to offer and displaying that to a consumer on Google Maps, websites, and all your social media outlets with a high definition interactive virtual tour. So many applications this product has to offer based on what you are wanting to highlight and showcase.\r\n\r\nHere are two quick examples of what a tour looks like on Google :\r\n\r\nExample 1: Reiver\'s Bar and Grill\r\nExample 2: Charlie\'s Bar and Grill\r\nExample 3: Restaurant Hoge Heren\r\n\r\n\r\nI attached a quick estimate based on your needs, wants, and budget. Please let me know your thoughts and what questions you might have regarding the photos and your Google Plus page. I look forward to answering any questions you might have regarding your account and photography. \r\n\r\nThank you,\r\nLuke Robinson\r\nKyros Group\r\n\r\nMobile (817) 888-6340\r\n\r\nwww.gokyros.com'),
(396, 'We love Bronson Rock and are there every week.  Wanted to see if there is a party room we could use for our daughters birthday?  As well as using your single man DJ for it.\r\nIf this is something you think could be possible, please let me know.\r\n\r\nThank you,\r\n\r\nLorie Low'),
(410, 'Hello,\r\n\r\nMy name is Kevin Milton, I\'m checking to see if my Daughter could have an opportunity to sing at an open mic night? Her name is Karoline Milton she is 16 years old. \r\n\r\nI have attached a video.\r\n\r\nVideos:\r\nhttp://www.reverbnation.com/artist/artist_videos/'),
(429, 'Hello. I am wondering about reserving the party room from Friday night February 27th and what all goes into doing that. Any information would be greatly appreciated. It is for a 40th birthday party for my husband.\r\n\r\nThank you.'),
(448, 'Greetings!  My name is Jason Elmore and I front a national touring act based out of Dallas called ‘Jason Elmore & Hoodoo Witch’.  We are a high-energy trio that plays mostly original material, which we call ‘American Music’ because we incorporate many different genres and styles such as classic soul, vintage country, swing, and even some hard rock, while maintaining a blues-oriented base throughout. \r\n\r\nWe are not a blues band in the traditional sense but we were voted ‘Best Blues act’ by the Dallas Observer Music Awards in 2012 and were nominated again in 2014.   We were also nominated for a Blues Blast award in 2014 for our sophomore album “Tell You What”.     We frequently tour the US and Canada (we also toured Belgium in 2014), and have shared the stage with many popular acts such as Jimmie Vaughan, Junior Brown, George Thorogood, Carolyn Wonderland, Tab Benoit, Tommy Castro, Peter Tork (Monkees), David Lindley, Bugs Henderson, Kim Simmonds (Savoy Brown), and many others.    We have 2 CD releases on the Underworld label, both of which are continually receiving international airplay on both radio and internet stations.   Our latest album enjoyed an unprecedented 6-month stay at the top of KNON 89.3 FM’s ‘Texas Blues Radio’ playlist.   I was recently the featured musical artist on the nationally syndicated WFAA television program ‘Good Morning Texas’.   \r\n\r\nIn addition to fronting ‘Jason Elmore & Hoodoo Witch’, I also stay in high demand as a solo acoustic act, where I perform an intense one-man show of both original and popular roots music.\r\n\r\nI would very much appreciate the opportunity to discuss a possible booking at your venue, as I am extremely confident in our large fanbase that I can draw a classy and attentive crowd that will eat, drink, tip, and thus generate more revenue and return customers for both you and I.  \r\n\r\nI sincerely hope to hear back from you either way, regarding a booking for the whole band or just a solo performance.  If you’re not interested at this time, please let me know so that I don’t follow up and inconvenience you.   If this is something that you might be willing to discuss, please contact me here or via any of the contact info below.   I’ve also included a link to my website where you can find out more if you’re interested, as well as 3 video links from recent performances (2 with the band and one solo performance).  \r\n\r\nI look forward to hearing back from you either way and hopefully to have the opportunity to work with you on scheduling an event for the near future.   Thanks, in advance, for your time and consideration on this! \r\n\r\nSincerely,\r\nJason Elmore\r\nwww.jasonelmore.net\r\n903-647-4951\r\n\r\nhttps://www.youtube.com/watch?v=6xE_8AhtIaU  (6 Foot Down, original tune, full band)\r\nhttps://www.youtube.com/watch?v=FVRDHYOD13g  (Strawberry Fields instrumental, full band cover)\r\nhttps://www.youtube.com/watch?v=HAO9WrlfY0k (Katie Mae, solo acoustic cover)'),
(453, 'Hi, my boyfriend and I where just up there today Wednesday January 28 2015 around 330pm. We sat on the patio. My boyfriend asked about the drink specials and we were both carded and I was denied drinking just because my id was an underage Id even though I\'m 21. She was very rude about the way she went about it. I didmt really care that I couldn\'t drink be I never tried to order a drink I just ordered water and was carded? But I left it alone and she came back to our table and tried arguing about the way my drivers licenses was backwards to the one in your book. I just didn\'t like the way I was treated and the way she went about things with my id. I was there a week ago and had no problem everyone was telling me happy birthday .'),
(458, 'Hi! My name is Mason Kinnaird and I am 17 years old and a junior in high school. I would love to work at Bronson Rock because of the great atmosphere and crowd. Please let me know what i have to do to get an interview! Thanks'),
(468, 'Hello,\r\nI was wanting to come to the Poo live crew concert tonight and someone said that it is 21 and up at night. My nephew is 16 and is usually allowed in with his parents who will also be there. Is this allowed?  If you would please get back with me today at your earliest convince I would appreciate it.\r\nThanks, \r\nTiffanie'),
(476, 'Hope that you would take a minute and look over our promo. We have been a working band since 2006. Some of the venues we play are the Horseshoe Casino Bossier City, Fat Jacks & Shooters in Texarkana, Auntie Skinners & The Franchise in Jefferson, Ricks on the Square & Iron Horse Saloon in Tyler, Leons Steakhouse & Players Club in Longview. We would love a change to play a venue with the quality of Bronson Rock. Thank you very much for your time! We look forward to hearing from you!'),
(482, 'Hello! My name is Michele. My boyfriend\'s 25th birthday is on Friday February 13th. and he has requested that we come to Bronson rock! we have been several times and love it! There will be 6 of us meeting there around 7:30 for dinner and then drinks and listening to the band after words. I was wondering if someone could get back to me in regards to reserving just 1 table in the back room to watch the band Good Questions.   Thank you guys.'),
(488, 'Hello, I visited Bronson last Saturday evening and had a great time by the way. Unfortunately; it appears that i have been double billed on both my credit card which I held the tab open; and my debit card in which I made final payment. The tab was $75.78 and I topped another $15.00 making the total $90.78. I need you to please credit my debit master card ending in 1009 or my Visa credit card ending in 4412. Will you please take a look and let me know when this is corrected? I appreciate your assistance.\r\nSincerely, \r\nCharles Miner 214-701-0870'),
(495, 'Hello, my name is CARBAYO and I’m a known country-rock artist in Spain (Europe).\r\n \r\nThis summer, to promote the release of my new album The Longlook Ride, I’ll be touring in acoustic format across the USA. I\'ve been selected to play in the Texas Sounds Awards to play as an international guest.\r\n\r\n My route passes through your city, which is why I’m offering to play in your establishment if you’re interested. I will be in Fort Worth  August 9th and 10th.\r\n\r\nI don’t ask for any payment, only dinner and drinks for 3 people and being allowed to pass the hat after our performance to make some tip money.\r\n\r\nI’ll leave you some links below to my music and information about me as an artist.\r\n\r\nI have seen that you also have an open mic night, so if you cannot get me a gig please let me into the open mic.\r\n\r\nI hope you like it and that we can meet soon.  Thank you very much.\r\n\r\nInfo;\r\n\r\nCARBAYO is the solo project of Alex Gunslinger, a musician and composer from Salamanca with a recognized and extensive trajectory in country-rock bands like Inblauk, Western Pacific and Two Gunslingers.\r\n\r\nA passionate fan of the Old West, this time he fuses country music he learned from several stays in Arizona with his deeply-rooted American rock influences.\r\n\r\nHe has just released his first album, The Longlook Ride, which narrates the adventures of a bounty hunter in the 19th-century American heartland.\r\n  \r\n"The Longlook Ride" is CARBAYO’s first solo album, recorded at Arcane Planet Studios in Salamanca and mastered in Nashville (USA) by 5-time Grammy  winner Richard Dodd (Tom Petty, Roy Orbison,Robert Plant, George Harrison, etc).\r\n\r\n“The Longlook Ride” is a complete work of 9 songs offering chronological narrative in the style of an old Dime-Novel, following the adventures of Longlook Mike, a fictional cowboy who lived in the United States in the second half of the 19th century.\r\n\r\nFrom his youth up to his life as a bounty hunter, his time as a soldier in the Civil War, his years as a bandit, all illustrated with great guitar work and an amazing voice.\r\n\r\nMusic:  https://play.spotify.com/album/4LtGvC27XgeAJY4xIyKuk9\r\n\r\n             https://soundcloud.com/carbayo-1 \r\n\r\nFacebook bandpage:  www.facebook.com/carbayomusic \r\n\r\nWebsite:  www.carbayo.com \r\n\r\nVideos:  https://www.youtube.com/channel/UCjo7g8WkAwU4O3QjFNrBvRw'),
(506, 'Hi my name is Christine and I am a parent volunteer for Trinity Springs Middle School. I am helping the coaching staff find food donations for our February 26th track meet at Timber Creek High School. We are hosting a hospitality booth for 75 coaches and are looking for any type of food donations. Salads, Sandwiches, something that\'s easy to put out and serve. We will display your business name in the room. If you are able to help in any way please contact me to set up a pick up time. Thank you any help is greatly appreciated! Christine'),
(525, 'Hey guys,\r\n\r\nI\'ve been to the bar a number of times. I rep for a company called Kill Cliff. We specialize in Recovery drinks that contain NO sugar. Our brand is most known in the crossfit world and since you have a bunch that frequent the bar I figured you might have some interest. They work well as a mixer and works with the healthy minded individuals. Would you mind if I brought by some samples?\r\n\r\nCory Procter \r\nNFL Alum'),
(532, 'We are currently booking the 2015 calendar for Rock And Roll Over, A Tribute to Kiss.  Rock and Roll Over was voted in the top 4 KISS tribute band in the world as rated by KISS themselves. They have a solid international fan base and put on a Spectacular show that is second to none, you would swear it was the original Kiss on stage. They traditionally sell out House of Blues and major casinos with tickets going as high as $35 each.\r\n \r\nRock and Roll Over is a Dallas/ Fort Worth based KISS tribute band consisting of Christopher (Paul Stanley) also with Hysteria - Def Leppard tribute, Paul Brown (Peter Criss) of JC Allstars, and Allen Shelley (Ace Frehley) of Woundtight, Jim Seda (Gene Simmons) with The Original KISS Army.\r\nOur mission and promise is to deliver a top flight KISS show, including KISS style guitars, costumes and theatrics, along with the top notch vocals, energy and tight choreography that people from all over Texas, and beyond have come to expect from a KISS tribute band fronted by top tier musicians.\r\n \r\nRock and Roll Over can also be packaged with a Def Leppard Tribute band Hysteria.\r\n \r\nHere are links to their bio and video, Feel free to submit offers.\r\n \r\nhttp://rockandrollover.net/'),
(538, 'Hello,\r\nI visited your website and it really whetted my appetite. It\'s too bad that I can\'t sample your food directly, but I do know how to connect you to a lot of businesses that can.\r\nTo grow your catering business, you may not be aware of all the marketing options available to you. Recommendations are great, but word-of-mouth, a sign on your vehicle or other marketing methods may not bring in enough orders. Unfortunately, these efforts are often expensive and not always effective because they depend on companies discovering you, among all your competitors.   And that doesn\'t always occur. So how can you find them?\r\nNow\'s your chance to get a taste of our innovative B2B marketing platform - Contact Us Channel (CUC). CUC is specifically designed for your catering needs. Our innovative B2B online platform lets you pinpoint the exact audience and location you want to approach proactively. You can target businesses directly in the precise radius of your delivery zone so that you don\'t waste time approaching irrelevant contacts.  \r\nOn top of that, registering with CUC is free! To cook up new business, simply go to www.contactuschannel.com and you can start bringing in orders for your next catering event today.'),
(545, 'Hi!  I was just curious if you\'ve had a chance to review the information I sent you last month for JASON ELMORE & HOODOO WITCH?   I\'d very much like to discuss a booking with you.  \r\n \r\nIf you\'re not interested, please let me know so that I can save us both time.   No response at all leaves me wondering if my inquiry went through or if I\'m just being ignored.   \r\n \r\nI look forward to receiving some kind of word either way.   Thanks in advance for the professional courtesy! \r\n \r\nJason Elmore\r\nwww.jasonelmore.net\r\n903-647-4951'),
(551, 'Reminder that tonight is the third Wednesday of the month and I have a jeep night event planned, looks like about 30 people have accepted formally, that could grow as the day goes. You are always very good and accommodating, but wanted to give you heads up so you will not be totally surprised. See you tonight.'),
(558, 'This message is for CJ :)  Hey CJ!  April here - we are planning another Breast Cancer Can Stick It! cycle ride fundraiser  with Texas Harley which I would like to have end at Bronson Rock again this year.  I was wondering what you\'d think of having a band at Bronson at the end of the ride? The date is Oct 4 and I haven\'t finalized everything with Texas Harley, but I wanted to jump on this with you now.    Dart me an email when you have a sec.  I had some bands in mind.  Thanks!'),
(579, 'Hey Bronson Rock staff,  \r\n\r\n   My name is Lynsi and I would like to introduce Fort Worth, Texas hip-hop artist Drew Barker. Drew has toured independently throughout the south and is one of the biggest rising acts in the Texas hip-hop scene. We are looking to book an event at your venue and we would love for you to check him out!  We really like your venue and would love to get in the mix! \r\n\r\nThanks and I hope to hear from you soon.\r\n\r\nStay Fresh,\r\n- Lynsi'),
(585, 'I have called and left several messages and been to someone would call back. That has not happened yet so I\'m trying this. We wanted information on a wedding/reception. Our wedding is September 9th and about 35 people. Could you please let me know if you do have something like this available? Oh and we would like early afternoon like 12. \r\n\r\nThanks \r\nJeri'),
(591, 'Hi,\nMy name is David Hjorth, President of D&D Energy Solutions.\nI help Texan-based businesses like yours save money on their energy costs by lowering their electric bills. D&D Energy Solutions is a full service Energy Consulting Firm founded to provide businesses with an unbiased way of lowering their energy rates.\nThrough my relationships with top retail electric and gas providers that I deal with daily, I am able to ensure that you receive the best electricity rates for your business. I tailor each gas or electricity savings programs to the specific needs of my clients. They span a wide variety of industries throughout the United States including government, manufacturing, commercial, retail and residential.\nI will beat any hard offer or hard electricity rate your company has been quoted by other energy brokers or retail electric providers.\nThis is a great opportunity for companies in Texas to get a consultation from my company, free of charge. All you need is a copy of your electric bill. Companies like yours may be eligible to get a commercial fixed electric rate as low as 4.96 cents per Kwh!\nSimply contact me today at 817-454-9878, email me at Firefly515@yahoo.com or visit www.danddenergysolutions.com'),
(597, 'I am thinking about having my 40th birthday party at Bronson on Sat. April 18.   Can I please have some information about it?  Would it be possible to reserve a table for 10-12 people by the outdoor stage?  Do you know yet which bands will be playing that night?  Thanks, Carrie'),
(603, 'Hello! I know you guys used to have a room to rent out for parties- is that still available? If so, could you send me information on the cost and what this includes? \r\n\r\nI am looking for a place to have my husbands 30th birthday on 3/20/15. \r\n\r\nThanks!\r\n\r\nWhitney'),
(608, 'Hi there! \r\nMy name is Brittany Plett and I  currently looking for a better and more exciting place of employment! I have served and bartended at BJs Restaurant and Brewhouse for the last 5 years and I am ready for a better opportunity! I also was a Regional Trainer for the company and trained most of the bartenders I worked with. On top of all that, I also cleaned the beer lines and did inventory. Please call or email and I hope to talk to you soon!\r\n\r\nThanks,\r\nBrittany Plett'),
(613, 'Hello.\r\n \r\nBow Dazzling is a 501 (c) (3) nonprofit organization created by Molly and her mom.  Molly is a 5-year cancer survivor, who was diagnosed with lymphoma in 2009 at the age of 15.  Our mission is to provide bows and headbands to young girls undergoing treatment for cancer and other serious medical conditions to give them encouragement and confidence.\r\n \r\nAs of January 1, 2015, Bow Dazzling has delivered more than 20,000 bows and headbands, made by volunteers, to Cook Children\'s Hospital in Fort Worth, Children\'s Medical Center and Scottish Rite Hospital in Dallas, and St. Jude Children\'s Research Hospital in Memphis.  Bows are a simple gift that can help a girl feel pretty and special and take her mind off of her illness.\r\n \r\nOn April 25, 2015, we are holding our 3rd Annual Bow Dazzling Pancake Breakfast & Silent Auction.  Guests will join us for a delicious breakfast, bake sale, bow making corner, and an exciting silent auction.  \r\n \r\nWe would love to have a gift certificate from Bronson Rock Restaurant in Keller for our guests to bid on.  Your generous donation will receive mention on our facebook page, in the event program, and on the auction table, plus we\'ll send you two complimentary tickets to join us for breakfast. Proceeds raised will allow us to continue our mission of making and delivering hand-crafted bows and headbands to brave, sweet girls in the DFW area children\'s hospitals and beyond.\r\n \r\nOur EIN# is 45-2394454 and the mailing address is 4401 Little Rd, Suite 550-328, Arlington, TX 76016.  Please let me know if further information is needed or if special request instructions should be followed.\r\n \r\nYour consideration is greatly appreciated.\r\n \r\nwww.bowdazzling.com\r\n \r\nwww.facebook.com/BowDazzling'),
(619, 'DONATION REQUEST - I am helping Central High School in Keller host a Project Graduation Event. Would your company support us with a donation? I am appreciative for all that you have done for our community. The CHS Project Graduation is scheduled for Saturday, May 30 – Sunday, May 31 for approximately 300 graduating CHS Seniors. I have a signed CHS Project Graduation donation request on letterhead & 501(c)3 for your review. Thank you in advance for your consideration.'),
(624, 'My name is Sarah and I am writing in regard to the Graceland Ninjaz.  They have played at Bronson Rock in the past and it went very well.  Last year the Ninjaz toured the following House of Blues locations: Dallas, Vegas, LA, San Diego, Anaheim, Orlando and Myrtle Beach ending the years in Vegas at the House of Blues. We are looking to schedule events for 2015 now.  We would like to see about scheduling some shows at Bronson Rock this year. And I wanted to see if you have any dates that could potentially work for a show this spring or summer.  I would love to fit you on the schedule now to ensure it happens! \r\n \r\nAlso, please check out the new Graceland Ninjaz sizzle reel: http://youtu.be/t5i7iuVV0M4\r\n \r\nLet me know your thoughts.\r\n\r\nSarah McMahon\r\nSpringbot Corp\r\nT: 972-672-7049'),
(629, 'My wife and I were in there about a month ago on a Thursday night and saw the ZZ Topp band. I think they were called Tres Grande or something and we really enjoyed watching them. When are they coming back? We would love to see them again and bring friends to watch, let me know, thanks, Ed. ejcole@verizon.net'),
(636, 'https://www.youtube.com/watch?v=LDHBFdQwHzo\r\n\r\nTHE ENABLERS  would like to book w/ your venue.   We play a variety of rock and dance music.   We play all over the metroplex such as gas monkey bar and grill, house of blues, sherlocks dallas.  We look forward to hearing from you. THANKS!'),
(642, 'I am in the process of finding a place for our 25th High School Reunion meet and greet. This will be our Friday night kick off for a weekends full of reunion activities.  We are looking at the date July 10, 2015. We are guesstimating maybe 100 people for the meet and greet. I personally have attended numerous bike nights there and recommended your place to our committee. What do we need to do next?\r\nThank you for your time,\r\nCyndi Sims\r\nClass of 1990 LD Bell'),
(647, 'I sent an email earlier this week about having our 25th high school reunion meet and greet there. The date is Friday July 10, 2015.  This event kicks off our weekend full of activities we have planned for a our 25th reunion. We are guesstimating maybe up to 100 for Friday night.  I\'m needing to know what I need to do or if there is anything I need to do to set this up with you. \r\nThank you \r\nCyndi Sims'),
(652, 'hi!  8 of us are coming there on Saturday night.  My birthday is Sunday and I am always the one to go and hold a table.  I was going to go at 530pm.  Wanna sit outside.  I would rather not go so early.  I heard you could reserve a table again.  For awhile there you would not do that.  If its possible, please let me know. My husband and I could come down by 630 or 7.  Thank you so much.  Hope you have a big crowd!!  Weather will be nice, especially with your heaters!!'),
(659, 'This is Ryan Barnes from Sweet Texas Crude. We would really enjoy playing your venue and feel we would be a great fit for your establishment and your patrons. You can check out the band and our music at www.sweettexascrude.com \r\nThank you and look forward to hearing back from you.\r\nRyan Barnes\r\nwww.sweettexascrude.com\r\n817-680-6181'),
(666, 'the wonderfuls band would love to bring the party bronson rock! We are booked all over for weddings and corporate partys and would like to start playing more night clubs and local high end establishments such as bronson rock. We have a great following and are known for not only the great music of all genres we are capable of preforming but for our all around entertainment quality and ability to keep hype going till its time to shut the place down. We hope you will consider putting us on your calendar  and giving us a trial run in the coming month or months! Thank you for your consideration and time in reviewing our videos which can be found on our face book page listed above and also our reviews on https://www.gigmasters.com/dance-band/the-wonderfuls'),
(673, 'Hello,\r\nMy name is Skyler Liv and I’m currently a solo artist looking for more opportunities to perform in the DFW area. I’ve been performing for five years at various venues in the DFW and Austin areas. We can sit down in person as well and discus. There is a link to my youtube in case you would like to get a feel for what I sound like!\r\n\r\nThank you for your time and I look forward to hearing from you!\r\nSkyler Liv'),
(678, 'Tanya,\r\n\r\nThis is James (DJ).  I didn\'t really get any closure as to why I got pulled out of rotation for DJing in Bronson.  Can you shed some light as to why I was dropped from rotation?  I have no bitter feeling towards Bronson or any of the staff, I\'d like to know why so I can make adjustments to better myself as a DJ.  Thank you.\r\n\r\nV/r\r\nJames\r\nDJ Paramio'),
(685, 'Hi,\r\n\r\nI was curious as to what band was going to be playing this Friday, March 20th? Your website says Ashmore but when I saw Professor D\'s website they said they would be playing at your venue. Can you advise what the correct band will be?\r\n\r\nThanks,\r\nAmanda'),
(703, 'Looking to book a venue for a 40th birthday party. Can you give me details (cost, minimum amount, hours, etc)? Do you have availability 4/18, 4/25, or 5/2? Do you know who your entertainment will be those Saturdays?'),
(716, 'I\'m going to have about 30 or 40 friends and family celebrating my 50th birthday party on March 28th.  I have a 20 year old daughter that wants to come, have dinner and watch the show with us.  Do you have to be 21 plus or do you allow minors to attend?\r\n\r\nThanks for your help.'),
(723, 'Hi,\nMy name is Ken from Instafund LLC.\nI came across your website and was wondering whether you are receiving the money you need for your business. When was the last time you had a great idea for your business but didn\'t know how you would fund it? \nWhether you need new equipment, are moving to a new location, have to pay off some debt, or simply need more cash flow, we can help! With Instafund LLC, you\'ll enjoy fast approval and easy processing of the funds you need. \nBad credit? That\'s not a problem. Instafund specializes in helping businesses that are not always approved by regular channels. What\'s more, you\'ll get a tax deduction on all the interest. \nFund your business today by emailing me at ken@instafundllc.com or calling me at 917-885-3462. You can also reach my assistant, Yvonne, at 347-851-7600.\nOr go to our website: www.instafundllc.biz'),
(729, 'The server\'s name who took my order over the phone was Lee Lee.  I asked for two Hippie Hallows no cheese and a DBL meant and cheese burger only with ketchup.\r\nWhen I got home I found a single meat patty on what is called a Classic Rock. \r\nWhile I love your burgers, it\'s beginning to be very frustrating ordering with you.\r\nI need someone to please call me as it seems that I was possibly charged for what I wanted but given the wrong item.') ;
